define(['Ti/_/declare', 'Ti/_/lang', 'Ti/_/UI/Widget', 'Ti/_/dom', 'Ti/_/style', 'Ti/Locale', 'Ti/UI', 'Ti/UI/ActivityIndicatorStyle'],
	function(declare, lang, Widget, dom, style, Locale, UI, ActivityIndicatorStyle) {

	var opacity = 0.3,
		setStyle = style.set;

	return declare('Ti.UI.ActivityIndicator', Widget, {

		constructor: function() {
			var contentContainer = this._contentContainer = UI.createView({
					layout: UI._LAYOUT_CONSTRAINING_HORIZONTAL,
					width: UI.SIZE,
					height: UI.SIZE
				});
			this._add(contentContainer);

			Widget.prototype.hide.call(this);

			contentContainer._add(this._indicatorIndicator = UI.createView());
			contentContainer._add(this._indicatorMessage = UI.createLabel());

			this._createImage();
		},

		_dark36 : "data:image/png;base64,",
		_white36 : "data:image/png;base64,",
		_dark72 : "data:image/png;base64,",
		_white72 : "data:image/png;base64,",

		_createImage: function() {
			this._transformName = style.discover('transform');
			if (!this._image) {
				this._image = dom.create("img", {
						className : "TiUIActivityIndicatorImage",
						style: {
							width : this.indicatorDiameter,
							position : "absolute",
							transitionDuration : '0ms'
						}
					},
					this._indicatorIndicator.domNode
				);
				this._image.style[this._transformName] = 'translate(0px,0px)';
			} else {
				this._image.style.width = this.indicatorDiameter + "px";
			}

			this._image.src = this["_" + this.indicatorColor + this.indicatorDiameter];
			this._indicatorIndicator.width = this.indicatorDiameter;
			this._indicatorIndicator.height = this.indicatorDiameter;
		},

		show: function() {
			Widget.prototype.show.call(this);
			this._count = 0;
			clearInterval(this._timer);
			this._timer = setInterval(lang.hitch(this, '_animate'), 50);
		},

		hide: function() {
			clearInterval(this._timer);
			Widget.prototype.hide.call(this);
		},

		_count: 0,

		_animate: function() {
			if(this._count == 19){
				this._count = 0;
			}
			this._image.style[this._transformName] = 'translate(0px, ' + -this.indicatorDiameter * this._count + 'px)';
			this._count++;
		},

		_defaultWidth: UI.SIZE,

		_defaultHeight: UI.SIZE,

		_messagePadding: 0,

		properties: {
			color: {
				set: function(value) {
					return this._indicatorMessage.color = value;
				}
			},
			font: {
				set: function(value) {
					return this._indicatorMessage.font = value;
				}
			},
			indicatorColor: {
				post: '_createImage',
				value: 'white'
			},
			indicatorDiameter: {
				post: '_createImage',
				value: 36
			},
			message: {
				set: function(value) {
					var indicatorMessage = this._indicatorMessage;
					indicatorMessage.left = value ? 5 : 0;
					return indicatorMessage.text = value;
				}
			},
			messageid: {
				set: function(value) {
					var indicatorMessage = this._indicatorMessage;
					indicatorMessage.left = value ? 5 : 0;
					return indicatorMessage.textid = value;
				}
			},
			style: {
				set: function(value) {
					if (~[ActivityIndicatorStyle.DARK, ActivityIndicatorStyle.BIG_DARK].indexOf(value)) {
						this.indicatorColor = 'dark';
					} else {
						this.indicatorColor = 'white';
					}
					if (~[ActivityIndicatorStyle.BIG, ActivityIndicatorStyle.BIG_DARK].indexOf(value)) {
						this.indicatorDiameter = 72;
					} else {
						this.indicatorDiameter = 36;
					}
				}
			}
		}

	});
});
